import Discover from "@/pages/discover";
import Mine from "@/pages/mine";
import Friend from "@/pages/friend";

const routes = [
    {
        path:"/discover",
        component:Discover
    },
    {
        path: "/mine",
        component: Mine
    },
    {
        path: "/friend",
        component: Friend
    }
]

export default routes;
